let U = {};

// /**
// * Documentation Starter
// *
// * @function         printDocs()
// * @description      This function scrubs a file for *all*
                       docstrings prefixed with a double forward 
                       slash and prints them. Does not take char
                       count.
// * @param
// * @example
// *
// *     print_docs() 
// */

U.printDocs = () =>
{
    let s = `C#fs`.scripts.quine(),o = ``,m,r = /\/\*\*\s*\n([^\*]|(\*(?!\/)))*\*(?:\/)/gim;
    while ((m = r.exec(s))) o += `\n\n${m[0]}`;
    return o.replace(/\/(?:\/)/g, '')
}

return {ok: true, msg: U.printDocs()}

}
